import React from 'react';

const Pin = (props) => {
  console.log(props.info.scale)
  return(
    <div className="pin"
      style={{
        backgroundColor: props.info.color,
        top: `${props.info.location[1]*(props.info.scale.x)}px`,
        left: `${props.info.location[0](props.info.scale.y)}px`
      }}>
      <label></label>
    </div>
  )
}

export default Pin;
